  - name: website-priorities
    description: ""
    priorityLevel: 200
    text: >-
      The main page header should have the TeamSpark icon to its left and it should stand out against its background.


      The download links should be toward the top of the page (after any heading and/or product overview/tagline).  Essentially once we've introduced what it is, the next thing (before we dive into details) should be the download section / links.


      The download links should be in the visual form of a button with an icon representing download (ideally an svg shared by all download "buttons").


      When presenting concepts, present in the following order (not all concepts need to be included in all cases, but when concepts in the following list are presented the should obey this order):


      - Providers (to show our broad support for providers and models)

      - Chat Session (because it's the main function of the app)

      - References

      - Rules

      - Tools

      - Workspaces (since they are collections of references, rules, and tools)

      - Settings (since they apply to workspaces)


      When using screenshots to demonstrate or represent areas of product functionality, make sure the screenshot content matches the product functionality being described.
