  - name: ts-overview
    description: TestSpark AI Workbench Overview
    priorityLevel: 500
    text: >-
      Our product is called TeamSpark AI Workbench.


      It is a desktop and command line client application that runs on Mac, Windows, and Linux.


      It allows you to use AI models from providers including: Anthropic (Claude), OpenAI (ChatGPT), Google (Gemini), AWS Bedrock, and Ollama.


      It allows you to easily build intelligent agents for solving hard problems.  


      These agents have memory and can learn, and they can also use tools.  


      You have complete control over the exact context sent by your agent to the AI.
    include: always
  - name: ts-refs
    description: References
    priorityLevel: 500
    text: >-
      References are they way that a TeamSpark AI Workbench agent collects and remembers information.


      A reference can be any kind of information.  It can be text that you create.  It can be information from document or web page.  It can summarizations of AI chat sessions or tool call results.  It can really be anything that the agent needs to know to do its job.


      In addition to the reference content, a reference has a name and description, a priority level (000-999), can be enabled or disabled, and can specify how it should be included in chat sessions (always, by agent request, or manually).


      The TeamSpark AI Workbench gives you tools to create and manage references.


      In addition, the TeamSpark AI Workbench provides an internal tool that allows the AI to manage and interact with references.  This tool is installed by default, and can be removed or disabled if desired.  The tool allows the AI to create a reference from any information it has access to, including the current chat history or via an tools to which it has access.  A common scenario might be:


      > Summarize the findings from this chat session in a new reference


      Or


      > Get the web page at http://somewebsite.com/document and convert its contents into a new reference


      In addition, the AI can use the references tool to add or remove references from the current context, which it will only do when directed by the user, or if a rule indicates it.  An example of using the AI in this way might be:


      > Include all references with the word "cancer" in their description in this chat session.
