    text: >-
      References are documents or pieces of information that can be included in your chat context. They help provide background information, guidelines, or specific details that the AI can reference when responding to your questions. The can serve as the "memory" of a workspace or chat session.


      You can set references to be inclued automatically in chat sessions, or you can add (or remove) them manually with the Context panel. You can also add a reference by mentioning it using @ref:referenceName in your message.


      If you have the internal References tool installed, the AI can create and modify references, and include them as needed, all based on your instructions in the chat session.
