  - name: ts-rules
    description: Rules
    priorityLevel: 500
    text: >-
      Rules govern the way that a TeamSpark AI Workbench agent instructs the AI to processes instructions and commands.


      A rule can be any kind of instruction for the AI.  They are essentially "system prompts" injected into each chat message to help the AI respond in the correct way.  If you want to apply prompt engineering techniques, rules are generally where you will do that.


      Rules are the way an agent "learns" (especially with respect to problem solving skills).


      Note: There is also a System Prompt under Settings that allows you to manage the system prompt used throughout the workspace and on every chat message, which should only be used for prompts that apply to everything in the workspace all the time. 


      In addition to the rule content, a rule has a name and description, a priority level (000-999), can be enabled or disabled, and can specify how it should be included in chat sessions (always, by agent request, or manually).


      The TeamSpark AI Workbench gives you tools to create and manage rules.


      In addition, the TeamSpark AI Workbench provides an internal tool that allows the AI to manage and interact with rules.  This tool is installed by default, and can be removed or disabled if desired.  The tool allows the AI to create a rule from any information it has access to, including, among other things, the current chat history and user instructions.  A common scenario might be:


      > Make a new rule so that you always output properties with attributes in markdown table form


      Or


      > Make a new rule for yourself that will ensure that when we encounter a challenge like this in the future you will process it using the technique that was successful above


      In addition, the AI can use the rules tool to add or remove rules from the current context, which it will only do when directed by the user, or if a rule indicates it.  An example of using the AI in this way might be:


      > Include all rules with the word "research" in their description in this chat session.


      Or


      > Review all rules and include any that appear to be relevant to the current chat session


      Note: The above could itself be a rule so that on every chat session the AI agent would review all rules to see if any rules need to be include in the current chat session context (useful mainly if you have many, many rules, or potentially conflicting rules).
