  - name: ts-rules-about
    description: About Rules
    priorityLevel: 500
    text: >-
      Rules are guidelines or constraints that help shape the AI's behavior and responses. They can be used to enforce specific policies, maintain consistency, guide problem solving, or provide additional context for how the AI should interact.


      You can set rules to be inclued automatically in chat sessions, or you can add (or remove) them manually with the Context panel. You can also add a rule by mentioning it using @rule:ruleName in your message.


      If you have the internal Rules tool installed, the AI can create and modify rules, and include them as needed, all based on your instructions in the chat session.
