    description: About Workspaces
    priorityLevel: 500
    text: >-
      All activity in TeamSpark AI Workbench takes place in a workspace. A workspace can be any folder you choose, which will then be used to store your prompt, settings, providers, references, rules, and tools. You can use one workspace for everything, or you can make workspaces for different projects (or "agents") to organize your work.


      If you are running TeamSpark AI Workbench for first time, select Create Workspace below, then select a new or empty folder to serve as your first workspace.
