  - name: workspaces-and-settings
    description: Information about workspaces and settings configuration
    priorityLevel: 650
    text: >-
      Workspaces:

      All activity in TeamSpark AI Workbench takes place in a workspace. A workspace can be any folder you choose, which will then be used to store your prompts, settings, providers, references, rules, and tools. You can use one workspace for everything, or you can make workspaces for different projects (or "agents") to organize your work.


      Settings:

      Settings such as the system prompt, chat session settings, and tool settings apply to the workspace.


      Settings Tab Features:

      - System Prompt: Configure the default system prompt for all chat sessions

      - Chat Settings: Adjust parameters like maximum chat turns, output tokens, temperature, and top-p values

      - Tools Settings: Configure the default PATH environment variable used for tool executions


      Workspace settings serve as defaults:

      - Chat session settings are used as defaults for new chat sessions (can be overridden per session)

      - Tool settings like PATH are used as defaults for all tool configurations (can be overridden per tool)
