  - name: tools-system
    description: Overview of the tools system and Model Context Protocol integration
    priorityLevel: 700
    text: >-
      Tools are specialized functions or capabilities that the AI can use to perform specific tasks. They extend the AI's abilities beyond just conversation, allowing it to interact with external systems, process data, or perform complex operations.


      Key Features:

      - Tools are automatically available to the AI when processing messages

      - They help the AI accomplish tasks more effectively and provide more comprehensive assistance

      - Tool calls include details like elapsed time, parameters passed, and results


      Model Context Protocol (MCP):

      This application uses the Model Context Protocol (MCP) to manage and interact with tools. MCP is an open protocol that standardizes how applications provide context to LLMs, similar to how USB-C provides a standardized way to connect devices.


      Resources:

      - Official documentation: modelcontextprotocol.io

      - Official collection of MCP servers: github.com/modelcontextprotocol/servers
