  - name: rules-system
    description: Complete guide to the rules system in TeamSpark AI Workbench
    priorityLevel: 750
    text: >-
      Rules govern the way that a TeamSpark AI Workbench agent instructs the AI to process instructions and commands. They are essentially "system prompts" injected into each chat message to help the AI respond correctly.


      Rules are the way an agent "learns" (especially with respect to problem solving skills). They are where you apply prompt engineering techniques.


      Rule Properties:

      - Name and description

      - Priority level (000-999, higher numbers = higher priority)

      - Can be enabled or disabled

      - Include setting: always, by agent request, or manually


      Usage:

      - Can be included automatically in chat sessions

      - Can be added/removed manually with the Context panel

      - Can be mentioned using @rule:ruleName in messages

      - If the internal Rules tool is installed, the AI can create and modify rules based on instructions


      Common AI-assisted scenarios:

      - "Make a new rule so that you always output properties with attributes in markdown table form"

      - "Make a new rule for yourself that will ensure that when we encounter a challenge like this in the future you will process it using the technique that was successful above"

      - "Include all rules with the word 'research' in their description in this chat session"

      - "Review all rules and include any that appear to be relevant to the current chat session"


      Note: There is also a System Prompt under Settings for prompts that apply to everything in the workspace all the time.
    include: agent
