  - name: references-system
    description: Complete guide to the references system in TeamSpark AI Workbench
    priorityLevel: 800
    text: >-
      References are the way that a TeamSpark AI Workbench agent collects and remembers information. They serve as the "memory" of a workspace or chat session.


      A reference can be any kind of information:

      - Text that you create

      - Information from documents or web pages

      - Summarizations of AI chat sessions or tool call results

      - Really anything that the agent needs to know to do its job


      Reference Properties:

      - Name and description

      - Priority level (000-999, higher numbers = higher priority)

      - Can be enabled or disabled

      - Include setting: always, by agent request, or manually


      Usage:

      - Can be included automatically in chat sessions

      - Can be added/removed manually with the Context panel

      - Can be mentioned using @ref:referenceName in messages

      - If the internal References tool is installed, the AI can create and modify references based on instructions


      Common AI-assisted scenarios:

      - "Summarize the findings from this chat session in a new reference"

      - "Get the web page at http://somewebsite.com/document and convert its contents into a new reference"

      - "Include all references with the word 'cancer' in their description in this chat session"
    include: agent
