  - name: chat-session-functionality
    description: Detailed description of chat session features and capabilities
    priorityLevel: 850
    text: >-
      The Chat Session (chat tab) is the central workhorse of TeamSpark AI Workbench. This is where you work with the AI models to create, explore, and solve hard problems.


      The chat session supports:

      - Selecting a provider and model (defaults to most recently selected provider/model)

      - Overriding any workspace settings, such as turn count, max output tokens, or model parameters like temperature or topP

      - Manually inspecting and modifying references and rules included in the chat session context

      - Reviewing usage statistics for the session and the most recent chat message and response


      Chat output includes details of any tool calls made during the processing of the chat message, including the elapsed time, the parameters passed, and the result of the tool call, in addition to the text response from the AI.
