  - name: teamspark-product-overview
    description: Overview of TeamSpark AI Workbench product features and capabilities
    priorityLevel: 900
    text: >-
      TeamSpark AI Workbench is a desktop and command line client application that runs on Mac, Windows, and Linux.


      It allows you to use AI models from providers including: Anthropic (Claude), OpenAI (ChatGPT), Google (Gemini), AWS Bedrock, and Ollama.


      It allows you to easily build intelligent agents for solving hard problems. These agents have memory and can learn, and they can also use tools. You have complete control over the exact context sent by your agent to the AI.
